/** @jsxImportSource @emotion/react */
import { css } from '@emotion/react';

const row = css`
  display: flex;
  flex-flow: row;
  background-color: #f9f9f9;
  padding: 12px 14px;
  margin: 4px;
  width: 100%;
  border-radius: 10px;
`;
const TopUserRow = () => {};
const UserRow = () => {
  return (
    <div css={row}>
      <div>1</div>
      <div>
        <span css={{ width: '25px', height: '25px', borderRadius: '50%' }} />
      </div>
      <div>Jason</div>
      <div>99</div>
    </div>
  );
};

export { UserRow, TopUserRow };
